char_display proc far
  mov  ah, 9
  mov  bh, 0
  mov  bl, color  ;ANY COLOR.
  mov  cx, 1  ;HOW MANY TIMES TO DISPLAY CHAR.
  int  10h
  ret
endp    

 gotoxy proc far
  mov dl, x
  mov dh, y
  mov ah, 2 ;SERVICE TO SET CURSOR POSITION.
  mov bh, 0 ;PAGE.
  int 10h   ;BIOS SCREEN SERVICES.  
  ret
endp



Drawingg proc FAR
 
				; This piece of code was intended only for testing, so if you are using this grpahics mode for your project make sure you
				; understand how it works well. for example if you are going to get mouse clicks from user, it might pbe difficult to 
				; set up unlike the graphics mode we usually use...


	       mov ax, 4F02h    ; This Graphics mode configuration uses SVGA configuration (https://en.wikipedia.org/wiki/Super_VGA)
				; which was not even created when asm86 first came out. I use it to be able to use 256 colors on 640x400
				; it should work fine on tasm/masm extension for VSCode if your project does not use mouse clicks as controls
	       mov bx, 0100h    
	       INT 10h      	;execute the configuration
	       MOV AH,0Bh   	;set the configuration
	       MOV CX, imgW  	;set the width (X) up to image width (based on image resolution)
	       MOV DX, imgH 	;set the hieght (Y) up to image height (based on image resolution)
	       mov DI, offset img  ; to iterate over the pixels
	       jmp Start    	;Avoid drawing before the calculations
	Drawit:
	       MOV AH,0Ch   	;set the configuration to writing a pixel
               mov al, [DI]     ; color of the current coordinates
	       MOV BH,00h   	;set the page number
	       INT 10h      	;execute the configuration
	Start: 
		   inc DI
	       DEC Cx       	;  loop iteration in x direction
	       JNZ Drawit      	;  check if we can draw c urrent x and y and excape the y iteration
	       mov Cx, imgW 	;  if loop iteration in y direction, then x should start over so that we sweep the grid
	       DEC DX       	;  loop iteration in y direction
	       JZ  ENDING   	;  both x and y reached 00 so end program
		   Jmp Drawit

	ENDING:
	Ret

Drawingg endp



print proc far
while:      

  call gotoxy  ;SET CURSOR POSITION FOR CURRENT CHAR.
  mov  al, [ di ]  ;CHAR TO DISPLAY.

  

  cmp  al, 24H   ;IF CHAR == 0

  je   finish  ;THEN JUMP TO FINISH.

  call char_display  ;DISPLAY CHAR IN AL WITH "COLOR".

  inc  x  ;NEXT CHARACTER GOES TO THE RIGHT.
  jmp  next_char

  inc  y  ;MOVE TO NEXT LINE.    
  mov  x, 5 ;X GOES TO THE LEFT.
next_char:
  inc  di  ;NEXT CHAR IN THE STRING
  jmp  while

finish:
inc  y  ;MOVE TO NEXT LINE.    
mov  x, 5 ;X GOES TO THE LEFT.
ret
print endp



MAIN PROC FAR
		   mov ax, @data
		   mov DS, ax


mov ah,0
mov al,3h
int 10h
  


	call Drawingg
	





 mov  di, offset mes
call print



mov ah,0AH
mov dx,offset INDATA ;Inputting user name
int 21H




mov ax,0600h ;Scroll Screen AH=06 (Scroll),AL=0 Entire Page
mov bh,07 ;Normal attributes
mov cx,0 ;from 0,0
mov dx,184FH ;To 18h,4fh
int 10h ;Clear Screen






Again:
call drawingg ;rendering



 mov  di, offset m1

call print




mov di,offset m2
call print


mov di,offset m3
call print



mov ah,0
int 16h ;Get Key Pressed from the user ASCII is saved in AL





CMP AL,	63H  ;if key is C

JE C

CMP AL,1BH; if key is ESC

JE ESCAPE

CMP AL,70H   ;if key is P

JE P

mov ax,0600h ;Scroll Screen AH=06 (Scroll),AL=0 Entire Page

mov bh,07 ;Normal attributes

mov cx,0 ;from 0,0

mov dx,184FH ;To 18h,4fh

int 10h ;Clear Screen


mov x,5
mov y,5


jmp Again
C:
P:
ESCAPE:
call drawingg ;rendering

	MAIN ENDP
END MAIN
